PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE Origins(N Integer Primary Key AutoIncrement, S VarChar(1024));
CREATE TABLE History(N Integer Primary Key, oId Integer, TimeStamp Integer, Operation Char(1), Note VarChar(4096), User VarChar(31), IP VarChar(255), Value VarChar(1024));
DELETE FROM sqlite_sequence;
CREATE INDEX i1 On History(oId, TimeStamp Desc);
CREATE INDEX i2 On History(TimeStamp);
COMMIT;
